import React from 'react';
import { Link } from 'react-router-dom';
import img_card1 from '../../assets/images/ramen-avant.jpg'
import s from './valeurcard1.module.scss';


const Valeurcard1 = () => {
    return (
        <div className="valeurcard">
            <img src={img_card1} className={s.img_card} alt="Image valorisant le fait maison chez Sunset Ramen"/>
        </div>
    );
  };

  export default Valeurcard1;
